import React, { useState } from 'react';
import './App.css';

function Navigation() {

  return (
    <nav class="navbar">
      <a href="#home">home</a>
      <a href="#about">about</a>
      <a href="#menu">menu</a>
      <a href="#products">products</a>
      <a href="#review">review</a>
      <a href="#contact">contact</a>
      <a href="#blogs">blogs</a>
    </nav>
  );
}

function Image() {
  return (
    <img className='image' 
    src='https://static.vecteezy.com/system/resources/thumbnails/025/066/829/small/cheesecake-with-ai-generated-free-png.png' />
  );
}

function Text() {
  return (
    <div>
    <h1>Cheesecake</h1>
    <h3>Cheesecake is a dessert made with a soft fresh cheese</h3>
    </div>
  );
}

function MainPage() {
  return (
    <div className='mainpage'> 
      <Image />
      <Text />
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Navigation /> 
      <br></br>
      <MainPage />
    </div>
  );
}

export default App;
